import './Navbar.css';
import { Link } from 'react-router-dom';
import React from 'react';

function Navbar() {
  return(
    React.createElement("header", { className: "navbar" }, 
    React.createElement("div", { className: "navbar__title navbar__item"},"Webshop",<Link to="/"></Link>),
    React.createElement("div", { className: "navbar__item", href:"/add-item"}, "Add Item"), 
    React.createElement("div", { className: "navbar__item", href:"/add-category" }, "Add Category"), 
    React.createElement("div", { className: "navbar__item"},"Cart", <Link to="cart">
  </Link>)
  ))
}


export default Navbar
